/* Procedure structure for procedure `spInsertOvertimeIn` */

/*!50003 DROP PROCEDURE IF EXISTS  `spInsertOvertimeIn` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spInsertOvertimeIn`(empno VARCHAR(50),worksched VARCHAR(50),ddate VARCHAR(50),timeIn VARCHAR(50))
BEGIN
