DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spShowDTR`(empno varchar(50),dteFrom varchar(50),dteTo varchar(50))
BEGIN
	Select *,
	/*Date,
	TIME_FORMAT(inAM,'%h:%i %p') as inAM,
	TIME_FORMAT(outAM,'%h:%i %p') AS outAM,
	TIME_FORMAT(inPM,'%h:%i %p') AS inPM,
	TIME_FORMAT(outPM,'%h:%i %p') AS outPM,
	TIME_FORMAT(otIn,'%h:%i %p') AS otIn,
	TIME_FORMAT(otOut,'%h:%i %p') AS otOut,
	*/
	DATE_FORMAT(Date,'%W')as Day,
	TIME_FORMAT(late,'%H:%i') as latefinal,
	TIME_FORMAT(undertime,'%H:%i') as undertimefinal  
	from dailytimerecord
	where
	employeeNo = empno and 
	Date between dteFrom and dteTo order by Date;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spUpdateDtr` */

/*!50003 DROP PROCEDURE IF EXISTS  `spUpdateDtr` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateDtr`(
	empno varchar(50),ddate varchar(50),cin varchar(50),
	bout varchar(50),bbin varchar(50),cout varchar(50),
	otin varchar(50),otout varchar(50),late TIME,undertime TIME)
BEGIN
	UPDATE dailytimerecord SET
	inAM =ltrim(cin),
	outAM = LTRIM(bout),
	inPM = LTRIM(bbin),
	outPM = LTRIM(cout),
	otIn = ltrim(otin),
	otOut = ltrim(otout),
	late = late,
	undertime = undertime
	where employeeNo=empno and Date = ddate;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spUpdateSpecificRecord` */

/*!50003 DROP PROCEDURE IF EXISTS  `spUpdateSpecificRecord` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateSpecificRecord`(state varchar(50),dtrtime varchar(50),ddate varchar(50),empno varchar(50))
BEGIN
    if(state = 'inAM')THEN
	UPDATE dailytimerecord set inAM = dtrtime where Date = ddate and employeeNo = empno;
	END IF;
	 IF(state = 'outAM')THEN
	UPDATE dailytimerecord SET outAM = dtrtime WHERE DATE = ddate AND employeeNo = empno;
	END IF;
	 IF(state = 'inPM')THEN
	UPDATE dailytimerecord SET inPM = dtrtime WHERE DATE = ddate AND employeeNo = empno;
	END IF;
	 IF(state = 'outPM')THEN
	UPDATE dailytimerecord SET outPM = dtrtime WHERE DATE = ddate AND employeeNo = empno;
	END IF;
	 IF(state = 'otIn')THEN
	UPDATE dailytimerecord SET otIn = dtrtime WHERE DATE = ddate AND employeeNo = empno;
	END IF;
	 IF(state = 'otOut')THEN
	UPDATE dailytimerecord SET otOut = dtrtime WHERE DATE = ddate AND employeeNo = empno;
	END IF;
    END */$$
DELIMITER ;

